'use strict';
let GetOffersMessage = require('./GetOffersMessage.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetOffersMessageBuilder extends GetOffersMessage {
    addOffer(offer) {
        this.offersList.add(offer);
    }
    addOffers(offers) {
        let i;
        if (this.offersList == null) {
            stdlib.print("offersList == nil");
        }
        if (offers != null) {
            for (i = 0; i <= offers.length() - 1; i += 1) {
                this.offersList.add(offers.get(i));
            }
        }
    }
    setRequestId(requestId) {
        this.requestId = requestId;
    }
    build() {
        return this;
    }
}
module.exports = GetOffersMessageBuilder
